import{_ as t,o as e,c as o,O as i}from"./chunks/framework.9482e208.js";const f=JSON.parse('{"title":"§ 15.2-6628 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/15.2-6628.md","filePath":"vacode/15.2-6628.md"}'),a={name:"vacode/15.2-6628.md"},n=i('<h1 id="§-15-2-6628-definitions" tabindex="-1">§ 15.2-6628 Definitions. <a class="header-anchor" href="#§-15-2-6628-definitions" aria-label="Permalink to &quot;§ 15.2-6628 Definitions.&quot;">​</a></h1><p>As used in this act the following words and terms have the following meanings unless a different meaning clearly appears from the context:</p><p>&quot;Act&quot; means the Northern Neck Chesapeake Bay Public Access Authority Act.</p><p>&quot;Authority&quot; means the Northern Neck Chesapeake Bay Public Access Authority created by this act.</p><p>&quot;Board of Directors&quot; means the governing body of the Authority.</p><p>&quot;Bonds&quot; means any bonds, notes, debentures, or other evidence of financial indebtedness issued by this Authority pursuant to this act.</p><p>&quot;Commonwealth&quot; means the Commonwealth of Virginia.</p><p>&quot;Participating political subdivision&quot; means any of the counties of the Northern Neck Planning District Commission or any other subdivision that may join the Authority pursuant to the act.</p><p>&quot;Political subdivision&quot; means a county, municipality, or other public body of the Commonwealth.</p><p>&quot;Site&quot; means any land holding that can improve public access to waters of the Commonwealth.</p><p>2005, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0842" target="_blank" rel="noreferrer">842</a>.</p>',11),s=[n];function r(c,h,u,p,l,d){return e(),o("div",null,s)}const _=t(a,[["render",r]]);export{f as __pageData,_ as default};
